import * as React from 'react';
import { useState } from 'react';
import { AppBar, Box, Button, Container, IconButton, Toolbar, Typography, Paper } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

function App() {
  const [isLoggedIn, setIsLoggedIn] = useState(false);

  const handleLogIn = () => {
    setIsLoggedIn(true);
  };

  const handleLogOut = () => {
    setIsLoggedIn(false);
  };

  return (
    <>
      <AppBar position="fixed">
        <Container fixed>
          <Toolbar>
            <IconButton edge="start" color="inherit" aria-label="menu">
              <MenuIcon />
            </IconButton>
            <Typography variant="h6">Nomad's Odyssey</Typography>
            <Box sx={{ flexGrow: 1 }} />
            {isLoggedIn ? (
              <Button color="inherit" variant="outlined" onClick={handleLogOut}>
                Log Out
              </Button>
            ) : (
              <>
                <Button color="inherit" variant="outlined" sx={{ mr: 3 }} onClick={handleLogIn}>
                  Log In
                </Button>
                <Button color="secondary" variant="contained">
                  Sign Up
                </Button>
              </>
            )}
          </Toolbar>
        </Container>
      </AppBar>
      <Box sx={{ backgroundImage: 'url(https://vsegda-pomnim.com/uploads/posts/2022-04/1650914206_25-vsegda-pomnim-com-p-almati-vid-na-gori-foto-27.jpg)', height: '50vh', backgroundSize: 'cover', display: 'flex', alignItems: 'center' }}>
        <Container fixed>
          <Typography variant="h4" sx={{ fontWeight: 'bold', color: 'white' }}>
            Nomad's Odyssey
          </Typography>
        </Container>
      </Box>
      <Paper sx={{ paddingTop: '72px', paddingBottom: '24px' }}>
        <Container fixed>
          <Typography variant="body1" sx={{ marginTop: '12px' }}>
            Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam auctor nisi et velit sollicitudin convallis.
            Aenean id consectetur lorem, sit amet interdum libero. Praesent at vestibulum sapien. Donec lobortis,
            ipsum eu egestas ullamcorper, est dolor faucibus eros, vitae vulputate lacus eros vel tortor. Nunc ultrices
            tellus sit amet metus lacinia placerat. Sed vehicula, sapien eget euismod imperdiet, nisi nulla pulvinar
            mauris, at faucibus lorem eros eu dolor. Sed sit amet urna quis sapien lobortis faucibus. Etiam vitae dui
            lacinia, fermentum risus eget, cursus orci. Sed eget velit vitae nisl lacinia dignissim eu vel sapien.
          </Typography>
        </Container>
      </Paper>
    </>
  );
}

export default App;
